!function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/main/partials/details-modal.html",'<div class="drug-detail-modal"><div class="modal-header"><h1 class="modal-title h2">{{ drug.name }}</h1><a class="close-button btn btn-primary" ng-click="done()">Done</a> <a class="follow-button btn btn-default" ng-click="toggleFollow()" ng-class="{\'following\': drug.following}"><span ng-hide="drug.following">Follow</span> <span ng-show="drug.following">Unfollow</span></a></div><div class="modal-body"><div class="loading-message" data-ng-if="!drug.details"><p>Fetching info about {{drug.name}}...</p></div><div data-ng-if="drug.details"><h2>Recalls</h2><div data-ng-if="drug.details.recalls"><h3>{{drug.details.recallDetails.length}} ongoing recall(s)</h3><div data-ng-repeat="r in drug.details.recallDetails"><dl><dt>Recall Number</dt><dd>{{r.recall_number}}</dd><dt>Product Description</dt><dd>{{r.product_description}}</dd><dt>Reason</dt><dd>{{r.reason_for_recall}}</dd></dl><hr data-ng-if="!$last"></div></div><div data-ng-if="!drug.details.recalls"><p>There are no open recalls.</p></div><h2>Drug Interaction Information</h2><dl data-ng-show="showInteractionDetails()" data-ng-repeat="interactionTypeGroup in drug.details.interactionDetails.interactionTypeGroup"><div data-ng-repeat="interactionType in interactionTypeGroup.interactionType"><h3>{{interactionType.comment}}</h3><dl data-ng-repeat="interactionPair in interactionType.interactionPair"><dt>Interactions</dt><dd>{{interactionPairConcepts(interactionPair)}}</dd><dt>Description</dt><dd>{{interactionPair.description}}</dd></dl></div><hr data-ng-if="!$last"></dl><div data-ng-show="!showInteractionDetails()"><p>No drug interaction information available.</p></div><h2>Label Changes</h2><div data-ng-if="drug.details.labelChanges"><h3>{{drug.details.labelDetails.length}} recent label change(s)</h3><div data-ng-repeat="l in drug.details.labelDetails"><dl><dt>Label Version</dt><dd>{{l.version}}</dd><dt>Effective Date</dt><dd>{{l.effective_time | fdaDate}}</dd><dt>Indications and Usage</dt><dd>{{l.indications_and_usage}}</dd><dt>Dosage and Administration</dt><dd>{{l.dosage_and_administration}}</dd></dl></div></div><div data-ng-if="!drug.details.labelChanges"><p>There have been no label changes in the last 90 days.</p></div></div></div></div>')}])}(),function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/main/partials/main-index.html",'<section role="search"><div class="container"><label for="selectDrugInput" class="sr-only">Search for medications by name</label><ui-select id="selectDrugInput" class="ui-select-scroll ui-select-auto-width ui-select-opaque" theme="bootstrap" data-ng-model="drug.selected" search-enabled="true" reset-search-input="true"><img style="width: 64px; height: 64px;" src="assets/images/icon-search.svg" alt><ui-select-match placeholder="Type a Medication Name..."></ui-select-match><ui-select-choices repeat="drug as drug in drugs | filter: $select.search">{{ drug }}</ui-select-choices></ui-select></div></section><main role="main" class="followed-drugs"><div id="content" class="container"><h2>Medications you\'re Following</h2><p class="empty-drugs-list alert alert-info" data-ng-show="followedDrugs.length === 0">To follow a medication, search above and click the “follow” button.</p><ul data-ng-show="followedDrugs.length"><li data-ng-repeat="drug in followedDrugs" class="panel" data-ng-class="highlightClass(drug)"><span class="status-icon"></span><h3 data-ng-click="manuallySelectDrug(drug)">{{ drug.name }}</h3><button class="btn btn-xs btn-follow" data-ng-click="removeDrug(drug)" data-ng-mouseover="hoverFollow()" data-ng-mouseleave="leaveFollow()"><span data-ng-show="followHovered">Unfollow</span> <span data-ng-hide="followHovered">Following</span></button><div class="drug-summary"><p data-ng-if="drug.details.recalls" data-drug-summary data-drug="drug" data-type="\'recall\'"></p><p data-ng-if="drug.details.labelChanges" data-drug-summary data-drug="drug" data-type="\'label\'"></p></div></li></ul></div></main><aside class="about-med-alerts"><div class="container"><div class="row"><div class="col-sm-10 col-sm-offset-1"><h2>Why Med Alerts?</h2><div class="purpose"><aside class="statistic"><span class="infographic-person"></span><p><span class="percentage">82%</span><br>of American adults take at least one perscription medications.</p></aside><p>The Med Alerts website allows the informed consumer to research individual drugs for recent recals, changes to the drug\'s label or other useful information. Just like subscribing to follow updates on social media, you may choose to "follow" a frequently used drug to be alerted of future changes.</p></div><div class="statistics"><aside class="statistic"><span class="infographic-person"></span><p><span class="percentage">29%</span><br>of American adults take 5 or more medications.</p></aside><p>According to FDA Research,approximately 106,000 deaths per year can be attributed to adverse reactions to prescription medications. One in five hospital visits is the direct result of a drug reaction. And adverse drug reactions are estimate to cost our country $135 billion dollars anually.</p></div></div></div></div></aside><footer><div class="container"><div class="row"><ul class="technical-details list-unstyled col-md-6"><li class="header"><h2>Made by SPARC</h2><p>This prototype was built by <a href="http://www.sparcedge.com/">SPARC LLC</a>, a Veteran Owned Small Business located in Charleston SC. We use Agile development and multiple open source technologies to deliver for our Federal and Commercial customers.</p><p>Open source technologies used:</p></li><li>Development Layer<ul><li>Play Framework</li><li>Scala</li><li>AngularJS</li><li>lodash</li></ul></li><li>Visual / Design Layer<ul><li>Bootstrap</li><li>Google Fonts</li></ul></li><li>QA Layer<ul><li>Scala Test</li><li>Jasmine</li><li>Karma</li></ul></li><li>DevOps Layer<ul><li>GulpJS</li><li>Docker</li></ul></li></ul><div class="feedback list-unstyled col-md-6"><h2>Feedback Welcome</h2><p>Medalerts was built as a beta to showcase our ability to rapidly create a product of value and in response to the RFP from 18F. It was scoped to create a lightweight app that delivers useful functionality to the user. This prototype leverages the openFDA beta research project and not for clinical use. Please refer to the OpenFDA <a href="https://open.fda.gov/terms/">Terms of Service</a>.</p><p>In future phases of development, the product roadmap may include:</p><ul><li>The ability to register and receive email, social or SMS notifications about the medications they follow.</li><li>Create and follow multiple lists.</li><li>Integration with other service APIs for a richer experience.</li><li>The ability to cross reference your list of followed drugs for adverse reactions to each other.</li><li>Increase information, crowdsourced reviews, and listing alternative drugs within each medications detail view.</li></ul><span>Submit feedback to <a href="mailto:18F@sparcedge.com?Subject=18f%20Feedback" target="_top">18F@sparcedge.com</a></span></div></div></div></footer><div id="mask" ng-class=\'{"mask-open": maskOpen}\'></div>')}])}(),function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/pattern/partials/main.html",'<div class="container"><div class="row pl"><div class="col-sm-9"><h1>Pattern Library</h1><h2 id="colorswatch">Color Swatch<div class="pl-example"><div class="pl-color-swatch pl-color-swatch-white"></div><div class="pl-color-swatch pl-color-swatch-black"></div><div class="pl-color-swatch pl-color-swatch-light-blue"></div><div class="pl-color-swatch pl-color-swatch-dark-blue"></div><div class="pl-color-swatch pl-color-swatch-light-red"></div><div class="pl-color-swatch pl-color-swatch-light-yellow"></div><div class="pl-color-swatch pl-color-swatch-light-green"></div><div class="pl-color-swatch pl-color-swatch-light-gray"></div><div class="pl-color-swatch pl-color-swatch-dark-gray"></div></div><h2 id="typography">Typography</h2><p id="typographyheading">All HTML headings, <code>&lt;h1&gt;</code> through <code>&lt;h6&gt;</code>, are available. <code>.h1</code> through <code>.h6</code> classes are also available, for when you want to match the font styling of a heading but still want your text to be displayed inline.</p><div class="pl-example"><h1>h1. heading</h1><h1>Drug Name : aBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h1><h2>h2. heading</h2><h2>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h2><h3>h3. heading</h3><h3>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h3><h4>h4. heading</h4><h4>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h4><h5>h5. heading</h5><h6>h6. heading</h6><h6>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h6></div><h3 id="typographybody">Body Copy</h3><p>The global default <code>font-size</code> is <strong>20px</strong>, with a <code>line-height</code> of <strong>1.5 em</strong>. This is applied to the <code>&lt;body&gt;</code> and all paragraphs. In addition, <code>&lt;p&gt;</code> (paragraphs) receive a bottom margin of half their computed line-height (10px by default).</p><div class="pl-example"><p>Paragraph</p><p>Nullam quis risus eget urna mollis ornare vel eu leo. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Nullam id dolor id nibh ultricies vehicula.</p><p>Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec ullamcorper nulla non metus auctor fringilla. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Donec ullamcorper nulla non metus auctor fringilla.</p><p>Maecenas sed diam eget risus varius blandit sit amet non magna. Donec id elit non mi porta gravida at eget metus. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.</p></div><h3 id="typographytitle">Title</h3><p>Title and subtitle, are available by way of <code>title</code> mixin.</p><div class="pl-example"><div class="title"><div class="title">Title</div></div><div class="title"><div class="subtitle">Subtitle</div></div></div><h2 id="buttons">Buttons</h2><h3 id="buttonbasic">Basic</h3><p>Use the button classes on an anchor, button, or input element.</p><div class="pl-example"><button type="button" class="btn btn-link">View All</button> <button class="btn btn-default" type="submit">Button</button> <input class="btn btn-default" type="button" value="Input"> <input class="btn btn-default" type="submit" value="Submit"></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-html">btn btn-link</span>\n                        <span class="pl-syntax-html">btn btn-default</span>\n                    </code>\n				</pre></div><h3 id="buttonclass">Class</h3><p>Use any of the available button classes to quickly create a styled button.</p><div class="pl-example"><button type="button" class="btn btn-default">Default</button> <button type="button" class="btn btn-default-alt">Default Alt</button><button type="button" class="btn btn-primary">Primary</button><button type="button" class="btn btn-primary-alt">Primary Alt</button><button type="button" class="btn btn-success">Success</button><button type="button" class="btn btn-info">Info</button><button type="button" class="btn btn-warning">Warning</button><button type="button" class="btn btn-danger">Danger</button><button type="button" class="btn btn-link">Link</button><button type="button" class="btn btn-text">Link</button></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-comment">btn btn-default</span>\n                        <span class="pl-syntax-comment">btn btn-default-alt</span>\n                        <span class="pl-syntax-comment">btn btn-primary</span>\n                        <span class="pl-syntax-comment">btn btn-primary-alt</span>\n                        <span class="pl-syntax-comment">btn btn-info</span>\n                        <span class="pl-syntax-comment">btn btn-warning</span>\n                        <span class="pl-syntax-comment">btn btn-danger</span>\n                        <span class="pl-syntax-comment">btn btn-link</span>\n                    </code>\n				</pre></div><h3 id="buttonclass">Class Alts</h3><p>Use any of the available button classes to quickly create a styled button.</p><div class="pl-example"><button type="button" class="btn btn-default skinny">Default</button> <button type="button" class="btn btn-default-alt skinny">Default Alt</button><button type="button" class="btn btn-primary skinny">Primary</button><button type="button" class="btn btn-primary-alt skinny">Primary Alt</button><button type="button" class="btn btn-success skinny">Success</button><button type="button" class="btn btn-info skinny">Info</button><button type="button" class="btn btn-warning skinny">Warning</button><button type="button" class="btn btn-danger skinny">Danger</button><button type="button" class="btn btn-link skinny">Link</button><button type="button" class="btn btn-text skinny">Link</button></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-comment">btn btn-default skinny</span>\n                        <span class="pl-syntax-comment">btn btn-default-alt skinny</span>\n                        <span class="pl-syntax-comment">btn btn-primary skinny</span>\n                        <span class="pl-syntax-comment">btn btn-primary-alt skinny</span>\n                        <span class="pl-syntax-comment">btn btn-info skinny</span>\n                        <span class="pl-syntax-comment">btn btn-warning skinny</span>\n                        <span class="pl-syntax-comment">btn btn-danger skinny</span>\n                        <span class="pl-syntax-comment">btn btn-link skinny</span>\n                    </code>\n				</pre></div><h3 id="buttontag">Tags</h3><p>Join available button classes and icon fonts to create a styled button.</p><div class="pl-example"><a class="btn btn-default-alt btn-prev" href="#"><i id="icon-arrow-left" class="icon-arrow-left"></i> <span class="btn-prev-label">Back</span></a></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-comment">btn-default-alt btn-prev icon-arrow-left</span>\n                    \n                    </code>\n				</pre></div><h2 id="forms">Forms</h2><h3>Basic</h3><p>Individual form controls automatically receive some global styling. All textual <code>&lt;input&gt;</code>, <code>&lt;textarea&gt;</code>, and <code>&lt;select&gt;</code> elements with <code>.form-control</code> are set to <code>width: 100%;</code> by default. Wrap labels and controls in <code>.form-group</code> for optimum spacing.</p><p>Form elements with <code>&lt;select&gt;</code> require <code>&lt;button&gt;</code> and ui-select.</p><div class="pl-example pl-ui-select"><div><form><ul class="intake-question-list"><p class="type-gray type-small">Select elements use ui-select to provide a typeahead dropdown. To force a visible scrollbar on select choices add <code>&lt;ui-select-scroll&gt;</code>. Since select elements are created with ui-select, <code>&lt;class="ui-select-scroll"&gt;</code> and <code>&lt;theme="bootstrap"&gt;</code> must be made available to the element.</p><li class="example"><span class="intake-question-label">Which Drug would you like to follow?</span> <span class="help-block">This is some helper text</span><ui-select name="example_select" data-ng-model="uiSelect.selected" theme="bootstrap" ng-change="updateVisible(question)" class="ui-select-scroll"><ui-select-match placeholder="Please Select">Please Select</ui-select-match><ui-select-choices repeat="option in options | filter: $select.search"><div data-ng-bind-html="option.name | highlight: $select.search"></div></ui-select-choices></ui-select></li></ul></form></div></div></h2></div><div class="col-sm-3"><div id="navbar"><ul class="nav" role="tablist"><li><a href="#/pattern/#iconfonts">Icon Fonts</a></li><li><a href="#/pattern/#colorswatch">Color Swatch</a><ul><li><a href="#/pattern/#colorswatchoption">Options</a></li></ul></li><li><a href="#/pattern/#typography">Typography</a><ul><li><a href="#/pattern/#typographyheading">Heading</a></li><li><a href="#/pattern/#typographybody">Body</a></li><li><a href="#/pattern/#typographytitle">Title</a></li></ul></li><li><a href="#/pattern/#buttons">Buttons</a><ul><li><a href="#/pattern/#buttonbasic">Basic</a></li><li><a href="#/pattern/#buttonclass">Class</a></li><li><a href="#/pattern/#buttontag">Tag</a></li></ul></li><li><a href="#/pattern/#forms">Forms</a></li></ul></div></div></div></div>')}])}();